import { NavLink } from "react-router-dom";


const Navbar = () => {
  return (
    <div>
      <div className="flex justify-between">
        <NavLink to={"/"}>
          <img src="" alt="Logo" />
        </NavLink>

        <div>
          <NavLink to={"/"}>
            <img src="" alt="home logo" />
          </NavLink>
          <NavLink to={"/cart"}>
            <img src="../public/favicon.ico" alt="cart logo" />
          </NavLink>
        </div>
      </div>
    </div>
  );
};

export default Navbar;
